import React, { useState } from 'react';
import { Calendar, dateFnsLocalizer } from 'react-big-calendar';
import { format, parse, startOfWeek, getDay, parseISO } from 'date-fns';
import 'react-big-calendar/lib/css/react-big-calendar.css';

const locales = {
	'en-US': require('date-fns/locale/en-US'),
};

const localizer = dateFnsLocalizer({
	format,
	parse,
	startOfWeek,
	getDay,
	locales,
});

// Mock events
const events = [
	{
		id: 0,
		title: 'Sprint Planning',
		start: parseISO('2025-06-16T09:15:00'),
		end: parseISO('2025-06-16T10:00:00'),
		platform: 'Zoom',
		zapyInvited: true,
	},
	{
		id: 1,
		title: 'Refinement Messaging',
		start: parseISO('2025-06-19T13:00:00'),
		end: parseISO('2025-06-19T13:50:00'),
		platform: 'Teams',
		zapyInvited: false,
	},
];

export default function VoiceAssistant() {
	const [selectedEvent, setSelectedEvent] = useState(null);
	const [joined, setJoined] = useState(false);

	// Mock transcript
	const transcript = `Backlog refinement meeting agenda

Vision Alignment (2 mins)
Quickly revisit the broader company mission. What is our purpose and overarching goal?

Last Session Review (5 mins)
Reflect on the previous iteration or sprint:
• What were the achievements?
• What are the pending tasks and why?

New Items to Address (5 mins)
• Time to address emerging concerns:
• Any urgent bugs or defects identified?
• Any fresh feedback from users or stakeholders?
• Are there new features or requirements to consider?

Meeting Notes:
- Registration flow needs to be split into frontend and backend tasks.
- Payment integration requires additional validation steps.
- Timeline for both tasks is set for next sprint.
`;

	return (
		<div className="min-h-screen bg-black flex flex-row items-start py-10 px-2">
			{/* Calendar */}
			<div className="max-w-2xl w-full">
				<div className="bg-white text-gray-900 rounded-xl shadow p-6 mb-8">
					<h2 className="text-xl font-semibold mb-4 text-blue-700">
						Google Calendar View (Mock)
					</h2>
					<Calendar
						localizer={localizer}
						events={events}
						startAccessor="start"
						endAccessor="end"
						style={{ height: 500 }}
						onSelectEvent={(event) => {
							setSelectedEvent(event);
							setJoined(false);
						}}
						eventPropGetter={(event) => ({
							style: {
								backgroundColor: event.zapyInvited ? '#bbf7d0' : '#fef08a',
								color: '#222',
								borderRadius: '6px',
								border: event.zapyInvited
									? '2px solid #22c55e'
									: '2px solid #eab308',
							},
						})}
					/>
				</div>
			</div>
			{/* Right Sidebar Panel */}
			<div className="w-[420px] ml-8">
				<div className="bg-white rounded-xl shadow p-6 mb-8 text-gray-800">
					{!selectedEvent && (
						<div className="text-gray-500 text-center">
							Select a meeting from the calendar
						</div>
					)}
					{selectedEvent && (
						<>
							<h3 className="text-lg font-semibold mb-2">
								{selectedEvent.title}
							</h3>
							<div className="mb-2">
								<span>Platform: {selectedEvent.platform || 'N/A'}</span>
							</div>
							<div className="mb-2">
								<span>Start: {selectedEvent.start.toLocaleString()}</span>
							</div>
							<div className="mb-2">
								<span>End: {selectedEvent.end.toLocaleString()}</span>
							</div>
							<div className="mb-4">
								{selectedEvent.zapyInvited ? (
									<span className="inline-block bg-green-100 text-green-700 px-2 py-1 rounded">
										Zapy AI Voice Assistant Invited
									</span>
								) : (
									<span className="inline-block bg-yellow-100 text-yellow-700 px-2 py-1 rounded">
										Zapy AI Voice Assistant Not Added
									</span>
								)}
							</div>
							<div className="mt-6">
								<h4 className="font-semibold mb-2 text-green-700">
									Transcription
								</h4>
								<pre className="bg-gray-100 rounded p-3 text-gray-800 whitespace-pre-wrap break-words text-sm max-h-96 overflow-auto">
									{transcript}
								</pre>
							</div>
						</>
					)}
				</div>
			</div>
		</div>
	);
}
